
public class ControlFlow6 {
//switch문 test
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// switch문
		int i = 78;
		switch (i / 10) {
		case (10):
		case (9):
			System.out.println("A");
			break;
		case (8):
			System.out.println("B");
			break;
		case (7):
			System.out.println("C");
			break;
		default:
			System.out.println("F");
			break;
		}
	}
}
